Difference between async(req,res,next) and async(req,res,()=>{}<p>I recently came across this code and I fail to understand why the <code>next</code> has been omitted from the <code>protect</code> function(inside <code>protectandauth</code> function) while it is included in the <code>protect</code> function originally.
I want to know the difference between <code>protect=async(req,res,next)</code>and <code>protect=async(req,res,()=&gt;{}</code>.</p>
<p>I also see that even though <code>next</code> is omitted in the <code>protect</code>(the one inside <code>protectandauth</code>) function, it is still used in the code after the 'if' statement, how is that possible?</p>
<p>Code:</p>
<pre><code>export const protect = async (req, res, next) =&gt; {
  if (
    req.headers.authorization &amp;&amp;
    req.headers.authorization.startsWith(&quot;Bearer&quot;)
  ) {
    let token;
    token = req.headers.authorization.split(&quot; &quot;)[1];
    const decoded = jwt.verify(token, &quot;kris&quot;);

    req.userId = decoded.id;

    try {
      req.user = await User.findById(req.userId).select(&quot;-password&quot;);

      next();
    } catch (error) {
      res.status(401).json(error.message);
    }
    if (!token) {
      res.status(404).json(&quot;no token found&quot;);
    }
  }
};

export const protectandauth = async (req, res, next) =&gt; {
  protect(req, res, () =&gt; {
    if (req.userId == req.params.id) {
      next();
    } else {
      res.status(401).json(&quot;not authorised&quot;);
    }
  });
};
</code></pre>

